export default class TilesetMetadata {
    constructor(options: any);
    _class: any;
    _properties: any;
    _extras: any;
    _extensions: any;
    hasProperty(propertyId: any): boolean;
    hasPropertyBySemantic(semantic: any): boolean;
    getPropertyIds(results: any): string[];
    getProperty(propertyId: any): any;
    setProperty(propertyId: any, value: any): boolean;
    getPropertyBySemantic(semantic: any): any;
    setPropertyBySemantic(semantic: any, value: any): boolean;
    get class(): any;
    get extra(): any;
    get extensions(): any;
}
